    return QueryBuilder.apply(this, (query) {
      return query.link(q, r'friends');
    });
  }

  QueryBuilder<User, User, QAfterFilterCondition> friendsLengthEqualTo(
      int length) {
    return QueryBuilder.apply(this, (query) {
      return query.linkLength(r'friends', length, true, length, true);
    });
  }

  QueryBuilder<User, User, QAfterFilterCondition> friendsIsEmpty() {
    return QueryBuilder.apply(this, (query) {
      return query.linkLength(r'friends', 0, true, 0, true);
    });
  }

  QueryBuilder<User, User, QAfterFilterCondition> friendsIsNotEmpty() {
    return QueryBuilder.apply(this, (query) {
      return query.linkLength(r'friends', 0, false, 999999, true);
    });
  }

  QueryBuilder<User, User, QAfterFilterCondition> friendsLengthLessThan(
    int length, {
    bool include = false,
  }) {
    return QueryBuilder.apply(this, (query) {
      return query.linkLength(r'friends', 0, true, length, include);
    });
  }

  QueryBuilder<User, User, QAfterFilterCondition> friendsLengthGreaterThan(
    int length, {
    bool include = false,
  }) {
    return QueryBuilder.apply(this, (query) {
      return query.linkLength(r'friends', length, include, 999999, true);
    });
  }

  QueryBuilder<User, User, QAfterFilterCondition> friendsLengthBetween(
    int lower,
    int upper, {
    bool includeLower = true,
    bool includeUpper = true,
  }) {
    return QueryBuilder.apply(this, (query) {
      return query.linkLength(
          r'friends', lower, includeLower, upper, includeUpper);
    });
  }

  QueryBuilder<User, User, QAfterFilterCondition> conversations(
      FilterQuery<Conversation> q) {
    return QueryBuilder.apply(this, (query) {
      return query.link(q, r'conversations');
    });
  }

  QueryBuilder<User, User, QAfterFilterCondition> conversationsLengthEqualTo(
      int length) {
    return QueryBuilder.apply(this, (query) {
      return query.linkLength(r'conversations', length, true, length, true);
    });
  }

  QueryBuilder<User, User, QAfterFilterCondition> conversationsIsEmpty() {
    return QueryBuilder.apply(this, (query) {
      return query.linkLength(r'conversations', 0, true, 0, true);
    });
  }

  QueryBuilder<User, User, QAfterFilterCondition> conversationsIsNotEmpty() {
    return QueryBuilder.apply(this, (query) {
      return query.linkLength(r'conversations', 0, false, 999999, true);
    });
  }

  QueryBuilder<User, User, QAfterFilterCondition> conversationsLengthLessThan(
    int length, {
    bool include = false,
  }) {
    return QueryBuilder.apply(this, (query) {
      return query.linkLength(r'conversations', 0, true, length, include);
    });
  }

  QueryBuilder<User, User, QAfterFilterCondition>
      conversationsLengthGreaterThan(
    int length, {
    bool include = false,
  }) {
    return QueryBuilder.apply(this, (query) {
      return query.linkLength(r'conversations', length, include, 999999, true);
    });
  }

  QueryBuilder<User, User, QAfterFilterCondition> conversationsLengthBetween(
    int lower,
    int upper, {
    bool includeLower = true,
    bool includeUpper = true,
  }) {
    return QueryBuilder.apply(this, (query) {
      return query.linkLength(
          r'conversations', lower, includeLower, upper, includeUpper);
    });
  }
}

